import React from 'react';
import PropTypes from 'prop-types'


const Opacity = {
  background: 'none',
  position: 'absolute'
}

const Nav = (props) => {
  return(
    <header className="sticky-top w-100">
      <nav className="navbar navbar-expand-lg" style={Opacity}>
        <a className="navbar-brand" href="#home" style={props.navStyle}>Internal Medicine</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarContent">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarContent">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a className="nav-link" onClick={(e)=>props.handleNav(e,'home')} style={props.navStyle} href="#home">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" onClick={(e)=>props.handleNav(e,'contact')} style={props.navStyle} href="#contact">Contact Us</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" onClick={(e)=>props.handleNav(e,'form')} style={props.navStyle} href="#form">Forms</a>
            </li>
          </ul>
        </div>
      </nav>
    </header>
  );
}

Nav.propTypes={
  navStyle: PropTypes.object.isRequired,
  handleNav: PropTypes.func.isRequired,
}

export default Nav;
